<script>
    const handleSubmit = async (e) => {

        e.preventDefault();

        const loader = e.loader();

        if (e.validate()) {

            const data = new FormData(e.target.closest('form'));

            loader.start();

            data.append('id', App.storage.get().id);

            const request = fetch('/wp-content/lp-modelo-step/request.php', {
                    method: 'POST',
                    headers: {
                        'X-CSRF-Token': '<?= $csrf_token ?>'
                    },
                    body: data
                })
                .then(res => res.json())
                .then(res => {
                    window.location.href = `/${res.next}`;
                })
                .catch(err => {
                    alert(err.toString());
                    loader.reset();
                });

        }
    }

    function changeBodyColor(color) {
        document.body.style.backgroundColor = color;
    }

    setTimeout(function() {
        changeBodyColor("#FFD3B6");
    }, 500);
</script>

